import React from 'react';
import './style.css';
import Post from './../Post'

/**
* @author
* @function PostList
**/

const postEntries = 
[
  { 
    id: 1,
    date: "28 May 2020",
    title: "Inital commit",
    content: "lskdjf" 
  },
  { 
    id: 2,
    date: "28 May 2020",
    title: "Inital commit",
    content: "lsk djf" 
  }
];



const PostList = (props) => {
  return(
    <>
      <h2>
          Recent Posts
      </h2>
      <section className="postList">
        {postEntries.map(post => (
        <Post entry={post} key={post.id} />
      ))}
      </section>
    </>
   )

 }

export default PostList
